import React from 'react';

const About = () => {
  return (
    <section id="about" className="about">
      <div className="about__content">
        <h2>About Me</h2>
        <p>
          I am a passionate software developer specializing in creating scalable,
          efficient, and user-friendly applications, combining technical expertise
          with innovative solutions to drive impactful results.
        </p>
      </div>
    </section>
  );
};

export default About;
